import{_ as e,o,c as t,O as n}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 24.2-623 Ballot containers to be supplied by governing bodies; construction and custody.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-623.md","filePath":"vacode/24.2-623.md"}'),a={name:"vacode/24.2-623.md"},r=n('<h1 id="§-24-2-623-ballot-containers-to-be-supplied-by-governing-bodies-construction-and-custody" tabindex="-1">§ 24.2-623 Ballot containers to be supplied by governing bodies; construction and custody. <a class="header-anchor" href="#§-24-2-623-ballot-containers-to-be-supplied-by-governing-bodies-construction-and-custody" aria-label="Permalink to &quot;§ 24.2-623 Ballot containers to be supplied by governing bodies; construction and custody.&quot;">​</a></h1><p>The governing body of each county and city shall provide a ballot container for each precinct. The container shall have a lock and key and an opening of sufficient size to admit a single folded or unfolded ballot and no more. The containers shall be kept by the electoral boards for use in the precincts.</p><p>Code 1950, § 24-241; 1970, c. 462, § 24.1-123; 1993, c. 641; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1015" target="_blank" rel="noreferrer">1015</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>.</p>',3),i=[r];function c(s,l,d,p,_,b){return o(),t("div",null,i)}const h=e(a,[["render",c]]);export{u as __pageData,h as default};
